import React from 'react'

import { FaHeart } from 'react-icons/fa'

const CardFooter = () => {
  return (
    <div className="card_footer">
        <div className="card_icon_menu">
            <FaHeart />
        </div>

    </div>
  )
}

export default CardFooter
